const Icon: React.FC<IconProps> = ({ active, fill, height, width, name }) => {
  console.log(pathObj[name]);
  // if (!pathObj[name]) throw Error("Error: There is no icon by that name!");
  return (
    <View
      style={{
        backgroundColor: "transparent",
        justifyContent: "center",
        alignItems: "center",
        width: width,
        height,
      }}
    >
      <Svg height="100%" width="100%" viewBox={viewBoxes[name]}>
        {pathObj[name]({ active, fill })}
      </Svg>
    </View>
  );
};

interface BoxedIconProps extends BoxViewType {
  fill: string;
  name: IconProps["name"];
}

export const BoxedIcon: React.FC<BoxedIconProps> = ({ fill, name, width }) => {
  return (
    <BoxView width={width}>
      <Svg height="100%" width="100%" viewBox={viewBoxes[name]}>
        {pathObj[name]({ fill })}
      </Svg>
    </BoxView>
  );
};

export default Icon;
